import { HTMLMorph } from "lively.morphic";
import * as vis from "https://lively-web.org/users/MattH/uploads/vis.js"
import { deepCopy } from "lively.lang/object.js";

export default class VisjsMorph extends HTMLMorph {
  onLoad(){
  this.loadGraph();
  }
  async loadGraph() {     
     this.viscanvasId = 'vis-canvas-' + this.id
     var htmlString = '<div style="height:100%" id="' + this.viscanvasId + '"/>'
     this.html = htmlString;
  var nodeArray = []
  var nodeCount = 3
  for(var i = 0;i<nodeCount;i++){
    nodeArray.push({id: i, label: 'Node ' + i, tt: 'Node ' + i})
  }
  var nodes = new vis.DataSet(nodeArray)
  var edgeArray = []
  nodeArray.forEach(function(ea){
    for(var j = ea.id; j<= nodeCount;j++){
      if(ea.id != j){
        edgeArray.push({from: ea.id, to: j})
      }
    }
  })
  var edges = new vis.DataSet(edgeArray)

  var container = this.domNode.querySelector('#' + this.viscanvasId)
  this.data = {
    nodes: nodes,
    edges: edges
  };

  var options = {
  interaction:{hover:true},

  manipulation: {
    addEdge: this.addEdge
  },

  physics:{
    enabled: true,
    repulsion: {
      centralGravity: 0.5,
      springLength: 200,
      springConstant: 0.05,
      nodeDistance: 50,
      damping: 0.09
    },
    maxVelocity: 50,
    minVelocity: 0.1,
    solver: 'repulsion',
    stabilization: {
      enabled: true,
      iterations: 1000,
      updateInterval: 100,
      onlyDynamicEdges: false,
      fit: true
    },
        timestep: 0.5,
        adaptiveTimestep: true
  },
  layout: {
    randomSeed: 1,
    improvedLayout:true
  }
}

  this.network = new vis.Network(container, this.data, options);
  this.singleClickListener(this)
  this.doubleClickListener(this)
  this.longClickListener(this)
  this.hoverListener(this)
  this.blurListener(this)
  this.rightClickListener(this)
  this.dragStartListener(this)
  this.dragListener(this)
  this.dragEndListener(this)
  }
   singleClickListener(self) {
    var network = this.network;
    var hand = $world.hands[0]
    network.on("click", function (params) {
      var node = params.nodes[0]
      if(!node){
        return
      }
    })
  }
  showTooltip(obj, blur) {
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
       container.removeChild(nodeDelete);   
       if(blur){
           return;
       }
    }
    var tt = document.createElement("div");
    tt.setAttribute("id", "tooltipNode");
    tt.setAttribute("class", "tooltipNode");
    this.setTTStyle(tt)

    var title = ( obj.tt == undefined ) ? ""  : obj.tt;
    tt.innerHTML = title;
    container.appendChild(tt);
  }
  hoverListener(self) {
     this.network.on("hoverNode", function (params) {         
        var HOVER_SIZE_ICON = 50;
        var nodeId = params.node;
        var node = self.data.nodes.get(nodeId);
        self.showTooltip(node); 

    });
  }  
  setTTStyle(tt) {  
    tt.setAttribute("style","position: absolute;\
	   text-align: center;\
	   top: 5%;\
    left: 20px;\
    background-color: #FFFFFF;\
    font-family: Roboto, Ubuntu, Verdana, Arial;\
    font-size: 0.65em;\
    padding: 5px;\
    border-radius: 5px;\
    border: solid 4px;\
    min-width: 0px;\
    max-width: 50%;\
    min-height: 0px;\
    max-height: 50%;")
  }
  blurListener(self){
    var network = this.network;
    network.on("blurNode", function (params) {      
      var node = self.data.nodes.get(params.node);
      self.hideTooltip();
    });
  }
  hideTooltip(){
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
        container.removeChild(nodeDelete);    
    }
  }
  longClickListener(self) {
    var network = this.network;
    network.on("hold", function (params) {      
      var node = params.nodes[0]
      if(node){
        //duplicate node here
        var nodeObj = self.data.nodes.get(node)
        var tempNode = deepCopy(nodeObj)
        tempNode.label = nodeObj.label + '_1'
        tempNode.id = nodeObj.id + '_1'
        self.data.nodes.update(tempNode)
      } else {
        //create node here
        var nodeCount = self.data.nodes.length + 1
        var {x,y} = params.pointer.canvas
        var nodeObj = {id: nodeCount, label: 'Node ' + nodeCount, tt: 'Node ' + nodeCount, x: x, y: y}
        console.log(params)
        self.data.nodes.update(nodeObj)
      }

    })
  }
  doubleClickListener(self) {
    var network = this.network;
    network.on("doubleClick", function (params) {
      if (params.edges.length == 1 && params.nodes.length == 0){
        network.editEdgeMode()        
      }
     })
  }
  rightClickListener(self) {
    var network = this.network;
    network.on("oncontext", function (params) { })
  }
  dragStartListener(self){
    var network = this.network;
    network.on("dragStart", function (params) {
      var node = self.data.nodes.get(params.nodes[0])

      console.log(params)
      if (node){
        node.physics = false;
        node.shadow = true;
        params.edges.forEach(function(ea){
          var edge = self.data.edges.get(ea)
          console.log(edge)
          edge.physics = false
        })
      }
    })
  }
  dragListener(self){
    var network = this.network;
    network.on("dragging", function (params) { })
  }
  dragEndListener(self){
    var network = this.network;
    network.on("dragEnd", function (params) {
      var node = self.data.nodes.get(params.nodes[0])
      if (node){
        node.physics = false;
        node.shadow = true;
        params.edges.forEach(function(ea){      
          var edge = self.data.edges.get(ea)
          console.log(edge)
          edge.physics = true
        })
      }
    })
  }
  addEdge(data,callback) {
    $world.get('cancelButton').visible = false    
    callback(data);

  }
  addNode(data,callback){
  }
  onResize(evt) {
    console.log(evt)
  }
}

